import React, { Component } from "react";
import imagesHead from "../helpers/imagesHead";



class Head extends Component {
  render() {
    const name='logo-de-la-udea'
    return (
      <div className="flex h-48 bg-white items-center w-341.5 mt-8.75 justify-center">
        <div className="ml-96 mr-20 w-1 bg-gray-900 h-22.5">    
        <h1>Hola</h1>
        </div>
        <div className="h-22.25 mr-20 w-51.5 ">
            <img src={imagesHead.img1} alt=""/>
        </div>
        <div className="h-22.5 mr-20 w-89.25 ">
        <img src="" alt=""/>
        </div>
        <div className="h-22.5 mr-96 w-21 ">
        <img src="" alt=""/>
        </div>
      </div>
    );
  }
}

export default Head;
